import React from "react";
import "./MainPage.css";
import Title from "./Title";
import PhoneImage from "./PhoneImage";
import InputField from "./InputField";

//testing out what the content will look like
function MainPage()
{
    return(
        <div id="content-wrapper">
            <div id="titles">
                
                    <Title
                        fontSize="150px"
                        fontWeight="lighter"
                        color="#666666"
                        text="#TECH"
                        marginTop="0px"
                    />
                    <Title
                        fontSize="50px"
                        fontWeight="lighter"
                        color="#b2b2b2"
                        text="New thinking. New #tech."
                        marginTop="-100px"
                    />
                <div id="sideContent">
                    <div>
                        <PhoneImage width="570px" height="570px"/>
                    </div>
                    <div>
                        <div>
                            <InputField type="text" width="45%" height="50px" placeholder="Email"/>
                        </div>
                       
                        <InputField type="password" width="45%" height="50px" placeholder="Password"/>
                          
                    </div>
                   
                </div>
            </div>
            <div id="content"></div>
        </div>
    );
}

export default MainPage;
